import { useRouter } from 'next/router';
import Layout from '../../components/MyLayout';

const Post = () => {
  const router = useRouter();
  const { id = ''} = router.query;
  return (
    <Layout>
      <h1>{id}</h1>
      <p>This is the content for {id} yeah!</p>
    </Layout>
  );
}

export default Post;
